import { createRouter, createWebHistory } from 'vue-router';
import HomePage from '../views/HomePage.vue';  // Cambiado a HomePage
import RegisterPage from '../views/RegisterPage.vue';  // Cambiado a RegisterPage

const routes = [
  {
    path: '/',
    name: 'HomePage',  // Cambiado a un nombre descriptivo
    component: HomePage
  },
  {
    path: '/register',
    name: 'RegisterPage',  // Cambiado a un nombre descriptivo
    component: RegisterPage
  }
];

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
});

export default router;
